import React, { useContext, useState } from 'react'
import { Container, Row, Col } from 'react-bootstrap'

// import { UserContext } from '../index'
import ProfileForm from './profileform'

function Profile() {

    // const { email } = useContext(UserContext);

    return (
        <Container>
            <Row>
                <Col md={2}>
                    <img className="card-img-top" src="https://image.flaticon.com/icons/svg/2095/2095102.svg" alt="profilepic"/>
                    <h5 className="card-title mt-3">Full Name</h5>
                </Col>
                <Col md={9}>
                    <ProfileForm/>
                </Col>
            </Row>
        </Container>
    )
}

export default Profile;
